import './App.css';
import styled from 'styled-components'

const Input = styled.input`
  padding: 0.5em;
  margin: 0.5em;
  color: "palevioletred";
  background: papayawhip;
  border: none;
  border-radius: 3px;
  outline: none;
`;


function App() {
  return (
    <div className="App">
      <h1>Calcule seus números primos</h1>
      <div>
        <Input></Input>
        <Input></Input>
        <button>Cálcular</button>
      </div>
      <p>Lista: números primos: 2, 3, 5, 7...</p>
    </div>
  );
}

export default App;
